        for node in self.iter():
            print(node)

    def print_backward(self):
        current = self.tail
        while current:
            print(current.data)
            current = current.prev
            
    def iter(self):

        current = self.head
        while current:
            item_val = current.data
            current = current.next
            yield item_val

