def transitive_closure(g):
    reachable = {v:dict.fromkeys(g, False) for v in g}

    for v in g:
        for n in v.get_neighbours():
            reachable[v][n] = True

    for v in g:
         reachable[v][v] = True

    for p in g: 
        for v in g:
            for w in g:
                if reachable[v][p] and reachable[p][w]:
                    reachable[v][w] = True

    return reachable


