        self.items.append(data)

    def dequeue(self):
        return self.items.pop(0)


def find_all_reachable_nodes(vertex):
    visited = set()
    q = Queue()
    q.enqueue(vertex)
    visited.add(vertex)
    while not q.is_empty():
        current = q.dequeue()
        for dest in current.get_neighbours():
            if dest not in visited:
                visited.add(dest)
                q.enqueue(dest)
    return visited


