def count_paths(m, n, holes):
    paths = [[-1]*(m + 1) for _ in range(n + 1)]

    if (0, 0) in holes:
        paths[0][0] = 0
    else:
        paths[0][0] = 1

    for x in range(1, n + 1):
        if (x, 0) in holes:
            paths[x][0] = 0
        else:
            paths[x][0] = paths[x - 1][0]

    for y in range(1, m + 1):
        if (0, y) in holes:
            paths[0][y] = 0
        else:
            paths[0][y] = paths[0][y - 1]

    for x in range(1, n + 1):
        for y in range(1, m + 1):
            if (x, y) in holes:
                paths[x][y] = 0
            else:
                paths[x][y] = paths[x - 1][y] + paths[x][y - 1]

    return paths[n][m]


